import { Link } from "react-router-dom";
import '../styles/Header.scss';

export default function Header() {
  return(
    <header>
      <div className="logo">Portfolio</div>
      <ul className="navigation">
        <li className="btn nav-btn"><Link to='/'>Home</Link></li>
        <li className="btn nav-btn"><Link to='/works'>Works</Link></li>
        <li className="btn nav-btn"><Link to='/experience'>Home</Link></li>
      </ul>
    </header>
  );
}
